(530774, 'Bếp Hồng Ngoại Sunhouse SHD6011 (2000W) - Đen- hàng chính hãng', '<h3><strong>Mặt kính siêu bền, vỏ nhựa cao cấp an toàn cho sức khỏe</strong></h3>\n<p><strong>Bếp hồng ngoại Sunhouse SHD6011</strong> có phần mặt bếp hồng ngoại bằng kính cường lực siêu bền, chống xước, chịu được nhiệt độ lên tới 600 độ C, tránh cho bề mặ', 1, 5, 2664, 12178, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(650250, 'Máy Hấp Thực Phẩm Magic Korea A64 (5.0 Lít) - Hàng chính hãng', '<h3>Thiết kế nhiều tầng, dễ sử dụng</h3>\n<p><strong>Máy Hấp Thực Phẩm Magic Korea A64 (500W)</strong> có dạng nhiều tầng, vô cùng tiện lợi khi bạn có thể cùng lúc có thể chế biến được các loại thực phẩm khác nhau. Tạo điều kiện cho bạn chuẩn bị lượng thức', 1, 5, 1658, 11312, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(771480, 'Túi Đeo Chéo Praza DCTK090 (25 x 15 cm) - Đen', '<ul>\r\n<li> <strong> Túi Đeo Chéo Praza DCTK090 (25 x 15 cm) </strong>sở hữu kiểu dáng nhỏ nhắn cùng thiết kế bo tròn thanh lịch, màu sắc lịch lãm, năng động giúp mang đến vẻ ngoài hiện đại, đầy phong cách cho bạn mỗi khi đeo bên mình. Bạn có thể sử dụng t', 440, 4, 36, 1253, 958, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(885374, 'Bàn Ủi Hơi Nước Đứng Philips GC518 (1600W) - Xanh Ngọc - Hàng chính hãng', '<h3>Thiết kế giá treo tiện lợi</h3>\n<p><strong>Bàn Ủi Hơi Nước Đứng Philips GC518 </strong>sở hữu thiết kế đơn giản, hiện đại với tông màu xanh trẻ trung kết hợp giá treo có thể điều chỉnh chiều cao linh hoạt phù hợp với trang phục hay người sử dụng.</p>\n', 1, 5, 840, 5093, 1946, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(896341, 'Máy Xay Thịt Đa Năng Thân Inox Chopper Midimori GC-24338 (500W) - Đen - Hàng chính hãng', '<h5 style=\"text-align:center;\"><iframe title=\"Quá Đã Máy Xay Thịt Midimori - Chỉ Với Công Suất 500W Làm Giò Chả Ngon Ơ\" src=\"//www.youtube.com/embed/6YWwy-9FmY4\" width=\"451\" height=\"801\" frameborder=\"0\" allowfullscreen=\"\"></iframe></h5>\n<h5 style=\"text-al', 1236, 5, 532, 2364, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1460199, 'Bếp Nướng Điện Sunhouse SHD4607 (1500W) - Hàng chính hãng', '<h3>Thiết kế gọn nhẹ, tiện sử dụng</h3>\n<p><strong>Bếp Nướng Điện Sunhouse SHD4607</strong> có thiết kế gọn gàng, trọng lượng cực nhẹ với khay nướng chỉ 765g rất tiện cho việc sử dụng tại nhà, di chuyển và bảo quản sản phẩm. Bếp có bộ điều chỉnh nhiệt lin', 1, 5, 1216, 11665, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1559899, 'Bếp Nướng Điện Happy Time Sunhouse HTD4606 (1500W) - Hàng chính hãng', '<h5>Thiết kế gọn nhẹ, tiện dụng</h5>\n<p><strong>Bếp Nướng Điện Happy Time Sunhouse HTD4606</strong> có thiết kế gọn gàng, trọng lượng cực nhẹ chỉ 1,8kg rất tiện cho việc sử dụng tại nhà, di chuyển và bảo quản sản phẩm. Bếp có bộ điều chỉnh nhiệt linh hoạt', 1, 5, 960, 5399, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1563561, 'Máy Xay Sinh Tố Đa Năng Sunhouse SHD5340B (500W) - Hàng chính hãng', '<h3>Thiết kế mới lạ</h3>\n<p><strong>Máy Xay Sinh Tố Đa Năng Sunhouse SHD5340 </strong>là một trong những mẫu mới nhất, có thiết kế mới lạ đẹp mắt, phối màu đen trắng sang trọng. Thân máy làm bằng nhựa cao cấp, độ bền cao giúp cho sản phẩm luôn bền đẹp tro', 1, 5, 493, 2210, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1752845, 'Bộ 10 Quần Lót Nữ Modal Miley Lingerie - Giao Màu Ngẫu Nhiên', '<h5>Kiểu dáng trang nhã</h5>\n<p><strong>Bộ 10 Quần Lót Nữ Modal Miley Lingerie </strong> có kiểu dáng gợi cảm với sắc màu tinh tế, trang nhã giúp tạo nên sức hút khó cưỡng cho phái đẹp. Form quần ôm vừa vặn, định hình tốt, tôn lên vòng 3 căng căng đầy quy', 8827, 5, 429, 1826, 4554, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(1908441, 'Bàn Ủi Khô Sunhouse SHD1072 - Hồng (1100W) - Hàng chính hãng', '<h3>Thiết kế gọn nhẹ, dễ sử dụng</h3>\n<p><strong>Bàn Ủi Khô Sunhouse SHD1072</strong> màu trắng kết hợp với màu hồng trẻ trung, bắt mắt làm sinh động không gian sử dụng. Tay cầm thiết kế vừa vặn giúp người dùng ủi chắc chắn, không gây mỏi khi phải ủi nhi', 1, 5, 357, 1791, 1946, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2316003, 'Quần Lót Nữ Thun Lụa CD Sớ Gỗ Fashion Miley Lingerie FWS1120', '<ul><li><strong>Quần Lót Nữ Thun Lụa CD Sớ Gỗ Fashion Miley Lingerie FWS1120 </strong>có kiểu dáng gợi cảm với sắc màu tinh tế, trang nhã giúp tạo nên sức hút khó cưỡng cho phái đẹp.</li>\n<li>Quần được dệt may theo công nghệ hiện đại, đường may tinh tế, s', 8827, 0, 0, 28, 4554, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2393139, 'Nồi Lẩu Điện Sunhouse SHD4521 (3L) - Hàng chính hãng', '<h3>Kiểu dáng hiện đại, sang trọng</h3>\n<p><strong>Lẩu Điện Sunhouse SHD4521 </strong>thu hút ngay cái nhìn đầu tiên đó là kiểu dáng và màu sắc. Hai màu chủ đạo đối lập và trắng và đen cộng thêm dáng trụ bán nguyệt tạo nên sức hút đặc biệt. Người tiêu dùn', 1, 5, 602, 3416, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2730205, 'Combo 4 cặp Lót giày êm chân Size Nữ - Màu ngẫu nhiên', '<p>Size Nữ từ size 35 đến size 40 (khách chỉ được chọn 1 size)</p>\n<p>Màu sắc: ngẫu nhiên tùy vào từng đợt sản xuất</p>\n<p>Chất liệu: mút ép vải</p>\n<p>Độ dày và mỏng ngẫu nhiên tùy vào từng đợt sản xuất (từ khoảng 2mm đến 4mm)</p>\n<p>Chuẩn size quốc tế</', 5087, 5, 32, 368, 8357, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3480333, 'Bình Đun Siêu Tốc 2 lớp Lock&Lock EJK738WHT (1.7 Lít) - Trắng - Hàng chính hãng', '<h3>Thiết kế hiện đại, sang trọng</h3>\n<p><strong>Bình Đun Siêu Tốc Lock&amp;Lock EJK738WHT</strong> có kiểu dáng mới lạ và không kém phần hiện đại với vẻ ngoài sang trọng. Bình được hoạt động với công suất mạnh mẽ 1800W và trang bị nút bật màu đen sử dụn', 1, 5, 2325, 13275, 1884, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
