INSERT INTO `rates` (`id`, `user_id`, `item_id`, `rate`, `comment`, `title`) VALUES
(1814450, 900417, 2316003, 3, 'quần chất 92 nylon, 8% spandex nên mặc hơi nóng, giá thành lại hơi cao so với thun lụa', 'tạm được'),
(2219367, 541970, 2730205, 1, 'Có rất nhiều từ để nói về sản phẩm. Kinh khủng! Siêu dỏm! Hàng gia công (phải dùng từ là thủ công) cẩu thả. Mình cũng biết là hàng OEM như này rất khó đánh giá chất lượng. Nên đánh được vào \"sự may mắn\" của chính bản thân. Nhưng khi nhận hàng mình cảm thấ', 'Hàng siêu lởm- Quảng cáo chỉ là quảng cáo!'),
(2332445, 9798178, 11782941, 3, 'Đã rất nhiều lần mua hàng trên TiKi..., nói chung đến giờ vẫn ổn. Duy chỉ có lần này mua đôi sandal mở gói hàng ra nhìn đôi dép thảm thương, quấn chằng qua loa khiến cho bị hỏng form dép . Gói hàng một cách rất cẩu thả và', 'không hài lòng'),
(2438801, 9793195, 14960854, 4, 'Dép đẹp giống hình. Tuy nhiên, có lẽ tại chân mình bé(21,5 cm) và mỏng nên mắt cá chân vừa chạm vào quai dép luôn, lúc đi lại cọ xát gây đau và bong tróc da dưới mắt cá chân.\nẢnh mình chụp sau khi đi mưa về', 'Đau chân'),
(2445076, 30605, 14885304, 1, 'Mình đặt sản phẩm này vào 30/08/2019 với combo 5 lọ giá khoảng 78k, lúc đó sản phẩm chỉ có 3 lựa chọn là 1, 5 và 10 lọ. Sau đó vào ngày thứ ba 03/09/2019 mình nhận được hàng là một cái hộp lớn với hơn 80% không khí và 1 lọ duy nhất.\nMình có gọi cho tiki v', 'Treo đầu dê bán thịt chó'),
(2478029, 1884285, 14960854, 4, 'Ấn tượng đầu tiên là shop cho cái hộp đẹp quá, mình mua chung với mấy sản phẩm nữa nên mở hộp tiki ra thấy bên trong còn thêm hộp này thật sự rất bất ngờ\nĐiểm trừ là trên mũi của chiếc bên trái bị hư một xíu\n\nNói thêm là chân mình dài 23cm ngang 9cm mang ', 'Hài lòng'),
(2573025, 11235435, 24286883, 5, 'cái này để làm gì vậy shop  . túi chất vải thì ok còn cái nhỏ2 đó k biết làm gì', 'Cực kì hài lòng'),
(2629279, 10116604, 24286883, 5, 'xinh xắn mềm mại rất dễ thương. đóng gói kỹ càng.  phục vụ tốt', 'Cực kì hài lòng'),
(2632992, 6363033, 650250, 5, 'Giao hàng nhanh cực kì, mới đặt tối hôm trước, hôm sau đã giao, mặc dù mình ở tỉnh. Nhận đc hàng khá ngạc nhiên, vì nhìn nó nhỏ hơn trong hình rất nhiều và nhẹ ^^. Nhưng về ráp lại thì nhìn khá hơn. Hấp cũng đc nhiều . Về hấp thử khoai lang, khoảng 15 phú', 'Rất ổn!'),
(2693117, 15229256, 6772415, 5, 'Em order lúc sáng nay mà giờ đã nhận được rồi. Cảm nhận đầu tiên là không ngờ nó nhỏ vậy ?. Không bị móp méo gì hết ạ. Em đang *** 10p như hướng dẫn, mùi khét và khói bay lên.\nKhông biết có xài bền không nữa. Hi vọng là xài bền', 'Vừa nhận được hàng'),
(2698695, 6226918, 14960854, 5, 'lúc đặt hàng do vội quá nên mình kh có đọc đánh giá nên chọn size mình thường mang là 39, thật sự thì hơi khít chân nhưng vẫn ok, mong là các quai sẽ dãn ra ạ. Đặt hàng thì nên chọn lớn hơn 1 size nếu bạn thích mang thoải mái, mang vừa thì chọn size mấy b', 'Cực kì hài lòng'),
(2700351, 13713524, 14960854, 5, 'mình ko đặt kì vọng vào đơn hàng này nhiều nhưng kết quả thì cực kì hài lòng và đẹp. anh sipper nhiệt tình.. do là dép nhựa nên hơi ôm sát chân một tý nếu bạn nào muốn đi thoải mái hơn thì đặt rộng hơn một size là oki \nmở hộp ra thì có mùi nhựa khá nặng n', 'Cực kì hài lòng'),
(2726914, 14809771, 14960854, 5, 'cực kì cực kì hài  lòng \n2 đôi y chang hình luôn, hỏng khác chổ bào hết, đống gói kỉ càng, gọn, màu y hình, mang rất vừa chân, nhẹ, nhìn gọn lắm nhe, đây hôk phải lần đầu tiên mình mua hàng, mà hàng giao rất đẹp và gọn, rất tỉ mỉ, rất ok, \nbn nào định mua', 'Cực kì hài lòng'),
(2749121, 5308614, 7170169, 1, 'shop làm ăn ko có tâm, đặt 5 cái size 3  XL , gửi lần thứ nhất ko đúng size, shop lấy về , gửi lai lần 2 nữa vẫn size cũ Xl, (cả 5 cái) nãn, shop tự hại mình, từ sau trở đi bye bye luon ko dám đặt hàng,  vì đâu co thgian mà gui đ', 'Rất không hài lòng'),
(2800235, 14915356, 28625283, 2, 'sản phẩm nhìn chắc chắn nhưng quai thô mang thử có lúc đi vòng quanh trong fòng lv mà đau chân k đi nổi. nói chung là chỉ bỏ trong hộp để nhìn. Chán', 'Không hài lòng'),
(2813004, 1071186, 6772415, 4, 'Mình mua 00:08\' giờ hôm nay mà tầm 17-18h đã giao rồi. Sản phẩm đẹp, chất lượng tốt, không bị méo mó gì và đóng gói cẩn thận. Hơi bé so với tưởng tượng.\n\nMình mở ra test theo hướng dẫn thì thấy đúng như vậy là có mùi khét một xíu, không biết có ảnh hưởng ', 'LÒ ĐẸP, ẤN TƯỢNG DÙ MÌNH THẤY CÓ VÀI \"HIỆN TƯỢNG LẠ\"'),
(2830792, 11435846, 21788290, 5, 'Giao hành nhanh, đúng sản phẩm, chất lượng tương đối so với giá.', 'Cực kì hài lòng'),
(2884755, 11026838, 1460199, 5, 'Đã nhận được sản phẩm đúng thời gian.\nMở ra kiểm tra thì thấy khá ổn.\nHiện tại chưa sử dụng nên chưa biết chất lượng ra sao. Mong sản phẩm bền lâu.\nLuôn tin tưởng Tiki vì chất lượng và thái độ phục vụ.\nMong đội ngũ của Tiki tiếp tục cố gắng và phát triển', 'Đã mua, hài lòng về việc giao hàng, mong sản phẩm đảm bảo chất lượng'),
(2920194, 16062986, 14960854, 4, 'sản phẩm tốt ạ, e mua đúng size, sợ nó chật như m.n nói nhưng khong hề ạ, chỉ có chiếc bên phải là nó bị rộng ở cổ chân 1 chút nhưng khong sao, với giá 87k là okee ròi ạ. Anh shipper cũng nhiệt tình lắm ạ.', 'khá hài lòng'),
(2942758, 1226304, 14885304, 1, 'Sản phẩm giống như 1 loại nước lau giày có mùi chứ ko phải dành để tẩy trắng giày. Trong khi shop bán lại bán combo 3 lọ, ko bán lẻ vậy mà mua về lại ko hiệu quả, phí hơn 80k. Vì tin tưởng hàng của tiki, nằm trong danh sách tiki now mới mua nhưng mua rồi ', 'Quá tệ - Vô dụng'),
(2996188, 5919938, 2393139, 4, 'Kiểu dáng gọn, lòng nồi tách rời với bếp nên dễ vệ sinh.  Nồi mới đun thử mất 10p để sôi nước, nước sôi mạnh, khi sôi có mùi sơn chống dính bốc lên (ko biết lúc cọ sạch có hết mùi ko). \nMình mua giá sales 309k, nói chung cũng khá hài lòng, tiền nào của nấ', 'Hài lòng'),
(3016835, 16383477, 26738046, 5, 'Mình rất hài lòng với đôi giay này ,no rất vừa vặn với bàn ch của mình', 'Cực kì hài lòng'),
(3019407, 10968287, 6772415, 5, 'Giao hàng siêu nhanh, vừa đặt chiều hôm qua mà trưa nay đã nhận được, hàng không bị móp méo gì luôn, mặc dù đã chuẩn bị tinh thần là nó rất bé cơ mà đến lúc nhận cũng hơi sốc 1 chút  xíu, cơ mà nhìn bé bé l xinh cực, dùng có vẻ ổn cơ mà đặt cây đánh trứng', 'Cực kì hài lòng'),
(3061974, 5156296, 31593583, 4, 'Mình mua sản phẩm để lót vào giày thể thao. Xong mình nghĩ sản phẩm phù hợp với giày búp bê hoặc có gót hơn. Do bề dày hơi mỏng nên lót vào mũi giày thể thao k khít được. Nhưng về chất lượng sản phẩm và giá thành thì mình thấy rất ok', 'Good'),
(3085230, 13657054, 7052713, 5, 'Nồi dùng tốt, mua hàng tiki giao nhanh tiết kiệm thời gian đi lại!', 'Cực kì hài lòng'),
(3093274, 13900707, 38496061, 3, 'mình 77kg, trước giờ toàn mặc 2XL, lần này sợ sai số nên có nhích lên 3XL cho thoải mái. Vậy mà cỡ 3XL shop giao tới, nhỏ tới nỗi mình tưởng size S, chỉ vừa cho các bạn học sinh cấp 2, nên mình không thể kéo nó lên đến đùi được.\nTrong khi mác trên quần vẫ', 'hú hồn'),
(3106330, 11400295, 6772415, 5, 'tuy hơi nhỏ nhưng chạy rất ok lần đầu con về sau thế nào chưa biết \ndk cái đóng gói rất cẩn thận  \nkèm theo sp  có một  cuốn hướng dẫn sử dụng  va một tờ phiếu bảo hành\nnhưng điều mình thắc mắc là phiếu bảo hành trống chơn ko có ghi j cả sp  j và ngày bn ', 'hài lòng'),
(3123769, 290724, 24286883, 5, 'Rất xinh. Chắc chắn và hợp giá tiền. Túi có thể đựng được lap 13 inches', 'Cực kì hài lòng'),
(3129394, 16096022, 7052713, 1, 'Nồi bị xì hơi xung quanh nắp, thật đáng buồn!', 'Rất không hài lòng'),
(3179334, 11250905, 21788290, 4, 'Sản phẩm mềm, nhưng khi đưa vào giày để đi thì bị đau chân do quá lớn làm chật giày', 'Hài lòng'),
(3350592, 598417, 26089569, 5, 'Túi vải dày dặn, đẹp đáng tiền nha mọi người', 'Cực kì hài lòng'),
(3384434, 181246, 1559899, 2, 'Mình vừa nhận hàng, thời gian giao hàng nhanh hơn dự kiến 1 ngày.\nVề bao bì đóng gói cẩn thận, quy chuẩn \nVề sản phẩm có một số thắc mắc cần giải đáp :\n1/ Thông tin trên tem bảo hành theo yêu cầu khách hàng mua phải tự điền đầy đủ và gửi cho Trung tâm bảo', 'Không hài lòng'),
(3402330, 1509835, 896341, 5, 'Cối inox an toàn, dao 2 tầng lưỡi nên xay thịt nhanh, thịt không dính vào cối, cấu trúc của dao dễ dàng vệ sinh sạch sẽ, có bọc lưỡi dao nên rất an toàn khi tháo lắp dao. \nLần trước mình mua cối thuỷ tinh của L&L bị vỡ, mua cối inox này xài thấy tốt hơn h', 'Cực kì hài lòng'),
(3411874, 13342544, 27531795, 1, 'Bữa mua giờ để quên ko dùng. Mới đưa ra dùng có hơn 1 ngày đã sổ chỉ, rớt ngay cục sạc dự phòng, phía trên có cái móc khóa cũng ko thấy giao gì hết. Ko hài lòng với sp này', 'Sp ko tốt'),
(3458978, 1604355, 13448092, 3, 'Quạt mát, ít ồn, nhanh hết pin, cắm điện xài trực tiếp thì ok hơn... mình đã rất thích và đặt mua nhiều lần cho bạn bè. Nhưng mà lần này giao hàng cũ cho mình, giống như đã xài rồi vậy. Hộp thì nguyên vẹn nhưng đã bạc màu. Quạt từ màu trắng ngã màu cháo l', 'Bình thường'),
