(11624785, 10001665, 2393139, 1, 'Phát khùng với cái nồi ạ. Bộ đinh ốc đi theo cái nắp nồi không phải cùng bộ với cái nồi . Vặn vào rất chật, xộc xệch và lọc cọc. Con ốc to nên ko có cố ráng vặn vào cái lỗ trên miếng nhựa đc ,nhựa rất giòn sợ gãy. 2 cái miếng để cố định con ốc thì quá nhỏ', 'Rất không hài lòng'),
(11658366, 387778, 3480333, 2, 'Chất lượng hoàn thiện kém, lớp nhựa đúc bên ngoài còn viền chưa mài đi.\nDây thì ngắn.\nẤm đặt lên đế thì cảm giác chông chênh.\nnắp thiết kế dở, khoá 1 chiều không nút unlock\nẤm này không xứng với giá tiền\ntóm lại thua xa sản phẩm khác dưới 200k.\nĐây có phả', 'Không hài lòng'),
