(13139669, 1167642, 114571809, 5, 'Điện thoại tui hư nên ko chụp ảnh được. Mặt hàng tốt như hình, mở đầu nhìn hộp tui nghĩ là hàng nhập Trung Quốc mà có vậy đi chăng nữa tui thấy hài lòng là được. Đại Phát khéo léo có viết tâm thư kèm thêm cái đồ cắt móng tay, chân. Cảm nhận thiện lành, sa', 'Cực kì hài lòng'),
